// define a function to extract the nth digit of a sequence of concatenated integers
function f_gold(n) {
    var bits = 1, t = 9;
    // calculate the number of digits in the sequence that contains the nth digit
    while (n > bits * t) {
        n -= bits * t;
        bits += 1;
        t *= 10;
    }
    // calculate the starting integer of the sequence that contains the nth digit
    var start = Math.pow(10, bits - 1) + (Math.floor(n / bits)) - 1;
    // return the nth digit
    if (n % bits == 0) {
        return start % 10;
    }
    return parseInt(String((start + 1)).charAt((n % bits) - 1));
}
